('1992','18','7667','Villa Llompart',Null,'Sehr gepflegte Villa im mediterranen Stil in Bendinat','25412','Nur 500 m vom königlichen Golfplatz in Bendinat entfernt und unweit von internationalen Schulen und diversen Supermärkten, steht diese im Jahr 2007 erstellte Villa in mediterranem Baustil. Der Bauherr legte viel Wert auf eine gehobene Bauqualität und hochwertig verarbeitete Materialien wie Teakholz für Fenster, Türen und Einbauschränke.\r\nIm Eingangs- und Wohn-Essbereich wurden Terracottafliesen verlegt. Im Obergeschoss liegen 3 Schlafzimmer und ein kleiner Salon, die alle mit Eichenparkett verlegt wurden. Insgesamt bietet die Villa 4 Schlafzimmer und 3 Badezimmer. Ein Außenpool und meherere Terrassen laden zum Relaxen ein.  Zwei Autos passen unter den überdachten Carport.','25413','1200000','111','2013-03-22 15:30:55','110','2013-03-22 15:31:32',Null,'1773','72','848',1,'1','0',Null,Null,Null,'25414',Null,'0','0','0',Null,'2015-04-09 10:12:31',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'25415',Null,'25416',Null,'25417',Null,'25418',Null,'25419','0',0,'0');
